import React from "react";
// import { Return } from "stylus/lib/nodes";
import {getFunName} from '../helpers';

function handleclick()
{
  <h1>hii</h1>;
}

class StorePicker extends React.Component
{
  render()
  {
    return(
    
      <form className="store-selector">
      {/*always put comments inside of the element tag*/}
        <h2>Please enter the store</h2>
        <input type="text" required placeholder="Store Name" defaultValue={getFunName()}></input>
        <button type="submit" onClick={handleclick()}>Visit Store</button>
      </form>
    );
  }
}

export default StorePicker;
